import React from 'react';

class PokedexList extends React.Component{
render(){
    const pokemon = this.props.pokemon
    return(
        <>
        <ul className="pokedexUl">
            <li>{pokemon.name}<img src={pokemon.img_url} alt="poke"/></li>
        </ul>
        </>
    )
}
}
export default PokedexList;
